import './Newpost.css';

function Header() {
    return <header>
        <h1>Epilogue</h1>
    </header>
}

function Newpost() {
  return (
    <div className="Newpost">
        <Header></Header>
        <hr></hr>
        <button type="submit">등록</button>
    </div>
  );
}

export default Newpost;
